import React from "react";
import s from "./CardPay.module.css"

const CardPay = () => {
  return (
    <div>
      <p>Credit Card Payment</p>
      <div className={s.wrapper}>

      <input id="name" name="name" className={s.fullInput} placeholder="Name on card" />

      <input id="number" name="number" type="number" className={s.fullInput} placeholder="Card number" />
      <div className={s.group}>

      <input id="expiry" name="expiry" placeholder="MM" />
      <input placeholder="YYYY" />

      <input id="cvv" name="cvv" placeholder="CVV" />
      </div>
      </div>
    </div>
  );
};

export default CardPay;
